import React from "react";
import "./lifeatmanet.css";
import { FaArrowLeft } from "react-icons/fa";
import { useNavigate } from "react-router-dom";

const LifeAtManet = () => {
  const navigate = useNavigate();

  const cards = [
    {
      id: 1,
      title: "Card One",
      buttons: [
        { text: "Button 1", link: "/page1" },
        { text: "Button 2", link: "/page2" },
        { text: "Button 3", link: "/page3" },
      ],
    },
    {
      id: 2,
      title: "Card Two",
      buttons: [
        { text: "Button A", link: "/pageA" },
        { text: "Button B", link: "/pageB" },
        { text: "Button C", link: "/pageC" },
      ],
    },
    {
      id: 3,
      title: "Card Three",
      buttons: [
        { text: "Button X", link: "/pageX" },
        { text: "Button Y", link: "/pageY" },
        { text: "Button Z", link: "/pageZ" },
      ],
    },
  ];

  return (
    <section className="lifeatmanet-section">
      <div className="overlay">
        <h1 className="life-title">Life at Manet</h1>
        <p className="life-subtitle">Explore what makes our community special</p>

        <div className="cards-container">
          {cards.map((card) => (
            <div className="card" key={card.id}>
              <h3 className="card-title">{card.title}</h3>
              <div className="card-buttons">
                {card.buttons.map((btn, index) => (
                  <button
                    key={index}
                    className="card-btn"
                    onClick={() => navigate(btn.link)}
                  >
                    <FaArrowLeft className="btn-icon" />
                    {btn.text}
                  </button>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default LifeAtManet;
